  const Cmp = props.cmp;
  var password = console.log(localStorage.getItem("admin"));
  var Auth = false;
  console.log(password);
  if (password === "" || password == undefined) {
    Auth = false;
    console.log(Auth);
  } else {
    Auth = true;
    console.log("else");
    console.log(Auth);
  }
  console.log(<Cmp />);
